	(29,'<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Home page:</span></p>\r\n<p><strong id=\"docs-internal-guid-b3196f22-9454-bc23-972f-3758198a7f2d\" style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Welcome.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The DMP tool is provided by the University of Alberta Libraries to help you write data management plans. &nbsp;</span></p>\r\n<p><strong style=\"font-weight: normal;\"><br /><br /><br /></strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Looking to Share Your Research Data? </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">More about the Libraries&rsquo; Research Data Services</span></p>\r\n<p><strong style=\"font-weight: normal;\"><br /><br /><br /><br /></strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">About the DMP Tool</span></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The University of Alberta has adopted a research records stewardship policy. &nbsp;This policy provides guidance on how research data and associated records should be managed and preserved. &nbsp;Furthermore, funding agencies are beginning to ask researchers to produce data management plans (DMP) as part of grant requirements.</span></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The University of Alberta Libraries has provided this DMP Tool to help researchers with &nbsp;data management planning process. &nbsp;This tool is powered by DMPOnline, which is produced by the Digital Curation Centre in the UK.</span></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">How the tool works</span></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Currently, there is a generic University of Alberta DMP template for researchers to use. &nbsp;Guidance is provided to help you interpret and answer the questions. &nbsp;</span></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">We want your feedback! &nbsp;If you have suggestions on how to improve the existing template, or you would like to add additional templates based on funding agency requirements or disciplinary needs, please contact us at </span><a style=\"text-decoration: none;\" href=\"mailto:data@ualberta.ca\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">data@ualberta.ca</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">.</span></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Getting started</span></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Please note that we are working on CCID authentication. &nbsp;If you are new to the DMP Tool, please create a new account. &nbsp;When we enable CCID authentication, you will have the option to link your existing DMP Tool account to your CCID. &nbsp;We apologize for this inconvenience.</span></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Feedback</span></p>\r\n<p><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">If you have any questions, comments, or suggestions about the DMP Tool, email us at </span><a style=\"text-decoration: none;\" href=\"mailto:data@ualberta.ca\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">data@ualberta.ca</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">.</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.15; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">\"&lt;p&gt;The DMP Tool is provided by the University of Alberta Libraries to help you write data management plans.&lt;br/&gt;&lt;br/&gt;&lt;a href=\'http://guides.library.ualberta.ca/content.php?pid=524929&amp;sid=4318282\' target=\'_blank\'&gt;Learn about Data Management Plans.&lt;/a&gt;&lt;br/&gt;&lt;a href=\'https://dataverse.library.ualberta.ca\' target=\'_blank\'&gt;Looking to share your research data?&lt;/a&gt;&lt;br/&gt;&lt;a href=\'http://library.ualberta.ca/researchdata\' target=\'_blank\'&gt;More about the Libraries\\\' research data services.&lt;/p&gt;\"</span></p>',49,5,1049144784,'2014-04-24 15:22:40','2014-04-24 15:22:40');
