	(853239785,'my shiny new research project',NULL,NULL,1020170275,'2014-04-24 15:12:20','2014-04-24 15:12:55','my-shiny-new-research-project',1071570821,'','','','Test User','','');
INSERT INTO `questions` (`id`, `text`, `question_type`, `default_value`, `suggested_answer`, `guidance`, `number`, `parent_id`, `dependency_id`, `dependency_text`, `section_id`, `created_at`, `updated_at`, `multiple_choice`, `multiple_permitted`, `is_expanded`, `is_text_field`)
VALUES
	(1049144766,'What types of data will you collect, create, acquire and/or record?',NULL,'','','Provide a short description of the types of data that will be generated in the research project (e.g., samples, physical collections, software, curriculum materials, and other materials to be produced during the course of the project).',1,NULL,NULL,'',1050936392,'2014-04-17 05:16:18','2014-04-23 02:34:38',0,0,1,0),
	(1049144767,'How will your data be collected, created, acquired and/or recorded? \r\n',NULL,'','','<p>Provide a short description of the data collection methods you will be using (eg. print vs. online surveys, audio vs. video recorded interviews, instrumentation, lab notebooks, etc.)</p>\r\n<p>If data are collected with mobile devices, please identify how will you transfer and store the data securely.</p> ',2,NULL,NULL,'',1050936392,'2014-04-17 05:18:24','2014-04-23 02:33:47',0,0,1,0),
	(1049144769,'Will you be using any existing data?  From where are you getting it and how will you be using it?  ',NULL,'','','Provide a brief description of any existing data sources you will be using, and describe how you will be using that data.  Describe how you will integrate this existing data source with data that you are collecting.',3,NULL,NULL,'',1050936392,'2014-04-23 02:36:55','2014-04-23 02:36:55',0,0,1,0),
	(1049144770,'How much data will you be collecting, and at what growth rate? How often will it change?',NULL,'','','Include an estimate of the amount of data being collected, how fast you anticipate it growing, and whether it will change over time.',4,NULL,NULL,'',1050936392,'2014-04-23 02:38:19','2014-04-23 02:41:46',0,0,1,0),
	(1049144771,'Which data formats will you use?',NULL,'','','<p>You should identify the file formats in which your data will be collected, stored, maintained, and made available, and any software/hardware needed to access and analyze the data.</p>\r\n<p>Do formats and software enable sharing and long-term validity of data, such as non-proprietary software and software based on open standards?</p>',5,NULL,NULL,'',1050936392,'2014-04-23 02:39:46','2014-04-23 02:40:36',0,0,1,0),
	(1049144772,'How will you document and describe what your data mean, how they were collected and the methods used to create them? ',NULL,'','','<p>Identify what procedural documentation you will create to explain the creation/management of data files.</p>\r\n<p>Describe any contextual details (metadata) that are necessary to make the data you capture or collect meaningful to you and others.Describe how you will create or capture these contextual details.</p>\r\n',1,NULL,NULL,'',1050936393,'2014-04-23 02:43:59','2014-04-23 02:43:59',0,0,1,0),
	(1049144773,'Which metadata standard will you use to annotate and describe your data?',NULL,'','','Provide a description of the metadata standard (e.g. DDI) and tools (e.g. Colectica) that you will use to annotate or describe your data. Will you use your discipline\'s metadata standard?  Where existing standards are absent or deemed inadequate, this should be documented along with any proposed solutions or remedies.',2,NULL,NULL,'',1050936393,'2014-04-23 02:48:52','2014-04-23 02:48:52',0,0,1,0),
	(1049144774,'How will you label and organize data, records and files in a consistent way?',NULL,'','','Describe the procedure you will use for naming files in a consistent manner.  What naming convention will you use? What project and data identifiers will be assigned, if applicable?  ',3,NULL,NULL,'',1050936393,'2014-04-23 02:53:41','2014-04-23 02:53:41',0,0,1,0),
	(1049144775,'Are your digital and non-digital data, and any backup copies, held in a safe and secure location?  How will you manage access and security?',NULL,'','','Provide a description of how your data will be organized, archived, and protected during your research project. This should include storage methods and backup procedures for your data, as well as the physical and digital resources needed. Any security or protection measures required for sensitive material or intellectual property should be addressed here as well, including who has access to the data.',1,NULL,NULL,'',1050936394,'2014-04-23 02:57:22','2014-04-23 02:57:22',0,0,1,0),
	(1049144776,'How many copies will you maintain and how will you keep them synchronized? How will you handle file versioning, so you always know which is the master version of your data?',NULL,'','','Describe how you and your research team will keep multiple copies of your data synchronized.  Please include whether you will be using any systematic means of versioning files (e.g. Dataverse or a source control management system like Github). If synchronization of the data by automated means is not possible, describe how you will keep track of it manually.',2,NULL,NULL,'',1050936394,'2014-04-23 03:05:24','2014-04-23 03:20:22',0,0,1,0),
	(1049144777,'Which data will be of long-term value and should therefore be retained, shared, and/or preserved?\r\n',NULL,'','','Indicate how data will be selected for archiving, how long the data should be held, and what your plans are for eventual transition or termination of the data collection in the future.  \r\n',1,NULL,NULL,'',1050936395,'2014-04-23 03:32:36','2014-04-23 03:32:36',0,0,1,0),
	(1049144778,'How will you prepare the data for preservation and access?  What are the anticipated file formats that will be used for preservation and access?  \r\n',NULL,'','','<p>If conversion is necessary, describe the transformations that are required to prepare data for long-term preservation and/or data sharing (e.g., data cleaning, normalization, or removing personally-identifying information where appropriate).  What file formats are most appropriate for preservation and for sharing?</p> \r\n<p>When converting data across formats, how will you check that no data or internal metadata have been lost or changed?</p>\r\n',2,NULL,NULL,'',1050936395,'2014-04-23 04:02:55','2014-04-23 04:04:22',0,0,1,0),
	(1049144779,'Where will the data be preserved for the long-term? How will it remain accessible?',NULL,'','','Indicate which archive, repository, central database, or data center you have identified as a place to deposit the data (e.g. ERA or Dataverse).',3,NULL,NULL,'',1050936395,'2014-04-23 04:30:23','2014-04-23 04:38:31',0,0,0,1),
	(1049144780,'What data will you share and in what form (raw/derived /published)? \r\n\r\n',NULL,'','','Provide a rationale for why you will share this data.  Describe which communities/groups are likely to be interested in the data. Describe the intended or foreseeable uses and users of the data.',NULL,NULL,NULL,'',NULL,'2014-04-23 04:40:13','2014-04-23 04:40:13',0,0,1,0),
	(1049144781,'What data will you share and in what form (raw/derived/published)? \r\n\r\n',NULL,'','','<p>Provide a rationale for why you will share this data.  Is data sharing stipulated in your grant? Is so, which data?</p>\r\n\r\n<p>Describe which communities/groups are likely to be interested in the data, and the intended or foreseeable uses and users of the data.</p>  ',1,NULL,NULL,'',1050936396,'2014-04-23 04:42:04','2014-04-23 17:18:10',0,0,1,0),
	(1049144782,'How will you share the data?\r\n',NULL,'','','<p>Describe which data will be shared and how you will make the data available including any resources needed such as equipment, systems, expertise, etc.</p>\r\n<p>Indicate when you will make the data available (including any factors such as embargo periods for political, commercial, patent reasons, or complying with publishing policies).</p>\r\n<p>Describe the process for gaining access to the data.</p>\r\n<p>Indicate if you anticipate that the original data collector, creator, or principal investigator retains the right to use the data before opening it up to wider use.</p>\r\n',2,NULL,NULL,'',1050936396,'2014-04-23 04:44:34','2014-04-23 17:18:51',0,0,1,0),
	(1049144783,'Under what conditions will data be shared and licensed for re-use (embargo considerations/creative commons licenses/upon request)?',NULL,'','','<p>Explain rationale for any restrictions on who may access the data and under what conditions, and if these restrictions will change over time.</p>\r\n\r\n<p>Indicate if there are any ethical and privacy issues related to sharing the data. If so, describe how those will be resolved if the data is shared (e.g., removing any personally identifying information in the data, working with institutional ethical committees, resolving potential conflicts by way of formal consent agreements).</p>\r\n',3,NULL,NULL,'',1050936396,'2014-04-23 04:47:04','2014-04-23 17:21:17',0,0,1,0),
	(1049144784,'Who will be responsible for data management during the project (i.e. data creation, processing, analysis)?',NULL,'','','List staff/organizational roles and their responsibilities for carrying out the data management plan (DMP). Include a description of time allocations, training requirements, and contributions of non-project staff, as appropriate. Indicate what will happen should personnel changes occur or if the PI leaves the institution. Describe the process for transferring responsibility for the data.',1,NULL,NULL,'',1050936397,'2014-04-23 17:28:03','2014-04-23 17:28:03',0,0,1,0),
	(1049144785,'Who will be responsible for data sharing and preservation after the project?',NULL,'','','Indicate who will have primary responsibility for how the data will persist over time when the original personnel are no longer associated with the project.  Indicate who will have primary responsibility for how the data will persist over time when the original personnel are no longer associated with the project.',2,NULL,NULL,'',1050936396,'2014-04-23 17:29:07','2014-04-23 17:29:07',0,0,1,0),
	(1049144786,'What resources will you require to implement your plan? Will extra people, time or hardware, storage be required?  How much will this cost (estimation)?',NULL,'','','<p>Include any costs for data management services.</p>\r\n<p>Include any costs for managing data during the course of the project as well as after the project is complete.</p>\r\n<p>Check with the funding agency to determine where in the proposal to include costs related to data management.</p>\r\n',3,NULL,NULL,'',1050936397,'2014-04-23 17:33:35','2014-04-23 17:33:35',0,0,1,0);
